    private class Data {
        String id;
        String raidsCompleted;
        String success;
        String failed;
        String assists;

        long time;
        Member member = null;

        private Data(String id, String rC , String success, String failed, String assists, long time) {
            this.id = id;
            this.raidsCompleted = rC;
            this.success = success;
            this.failed = failed;
            this.assists = assists;
            this.time = time;
            getMember();
        }

        public void getMember() {
            Guild guild = Goldilocks.jda.getGuildById("451171819672698920");
            if (guild == null) return;
            member = guild.getMemberById(id);
        }

        public String toString() {
            return "('" + (member == null ? "None" : member.getEffectiveName().replaceAll("[^A-Za-z]", "")) + "', " + id + ", " + raidsCompleted + ", " + success + ", " + failed + ", " + assists + ", DATETIME('" + time + "','unixepoch'))";
        }

    }

    Message mockAFK;
    HashMap<Member, InteractionHook> hooks = new HashMap<>();

    private void listener() {
        Goldilocks.eventWaiter.waitForEvent(ButtonClickEvent.class, e -> {
            return Objects.equals(e.getMessage(), mockAFK) || hooks.containsKey(e.getMember());
        }, e -> {
            Member member = e.getMember();
            String compId = e.getComponentId();
            if (hooks.containsKey(member)) {
                e.deferEdit().queue();
                if (compId.equals("yes")) {
                    hooks.get(member).editOriginal("Thank you for confirming! The location for this raid is `Testing Location`").setActionRows().queue();
                } else {
                    if (hooks.get(member) != null) hooks.get(member).deleteOriginal().queue();
                }
                hooks.remove(member);
            } else {
                e.reply("**`Reaction Confirmation`** Are you sure you have this <:TheNestKey:767819092467253289> and are bringing it to the run?")
                        .setEphemeral(true).addActionRows(ActionRow.of(Button.success("yes", "Yes"), Button.danger("yes", "No"))).queue(hook -> {
                    hooks.put(member, hook);
                });
            }

            listener();
        }, 5L, TimeUnit.MINUTES, () -> {mockAFK.delete().queue();});
    }

    private EmbedBuilder dungeonEmbed(Member member, List<Dungeon> dungeons) {
        EmbedBuilder embedBuilder = new EmbedBuilder();
        embedBuilder.setTitle("Raid Type Leading Selection for " + member.getEffectiveName());
        embedBuilder.setColor(Goldilocks.BLUE);
        embedBuilder.setDescription("Please select a type for your raid by typing the number of the corresponding type below.");

        String[] dungeonTypes = {"legendary"};
        String[] dungeonVisNames = {"Legendary Dungeons"};

        for (int i = 0; i < dungeonTypes.length; i++) {
            int finalI = i;
            embedBuilder.addField(dungeonVisNames[i], dungeons.stream()
                    .filter(n -> n.dungeonCategory.equals(dungeonTypes[finalI]))
                    .map(n -> "`" + (n.enabled ? "✅" : "❌") + "` " + "**" + (dungeons.indexOf(n) + 1) + ".** " + Goldilocks.jda.getEmoteById(n.dungeonInfo[0]).getAsMention() + " " + n.dungeonName)
                    .collect(Collectors.joining("\n")), true);
        }

        embedBuilder.setFooter("To exit the raid selection gui type: close");

        return embedBuilder;
    }

    private List<ActionRow> getActionRows(List<Dungeon> dungeons) {
        List<Button> curRow = new ArrayList<>();
        List<ActionRow> actionRows = new ArrayList<>();
        for (int i = 0; i < dungeons.size(); i++) {
            Button button = Button.of((dungeons.get(i).enabled ? ButtonStyle.SUCCESS : ButtonStyle.DANGER), "dungeon" + i,
                    dungeons.get(i).dungeonName).withEmoji(Emoji.fromEmote(Goldilocks.jda.getEmoteById(dungeons.get(i).dungeonInfo[0])));
            if (curRow.size() < 5) curRow.add(button);
            else {
                actionRows.add(ActionRow.of(curRow));
                curRow = new ArrayList<>(Collections.singletonList(button));
            }
        }
        actionRows.add(ActionRow.of(curRow));
        actionRows.add(ActionRow.of(Button.danger("dungeonclose", "Close")));
        return actionRows;
    }

    private void dungeonListener(Message controlPanel, Member mod, Member member, List<Dungeon> dungeons) {
        Goldilocks.eventWaiter.waitForEvent(ButtonClickEvent.class, e -> {
            return e.getComponentId().contains("dungeon") && Objects.equals(e.getMember(), mod) && Objects.equals(e.getMessage(), controlPanel);
        }, e-> {

            e.deferEdit().queue();

            if (e.getComponentId().contains("close")) {
                controlPanel.delete().queue();
                return;
            }

            int dungeonIndex = Integer.parseInt(e.getComponentId().replaceAll("[^0-9]", ""));
            dungeons.get(dungeonIndex).toggle();
            controlPanel.editMessage(dungeonEmbed(member, dungeons).build()).setActionRows(getActionRows(dungeons)).queue();
            dungeonListener(controlPanel, mod, member, dungeons);

        }, 2L, TimeUnit.MINUTES, () -> {
            controlPanel.delete().queue();
        });
    }




